Here's a GNU Octave script that finds the smallest possible value of $x$ greater than 10 that satisfies the given condition:

```
function x = find_x(x_start)
    for x = x_start:inf
        S = [2, 4, 10, x];
        primes = [];
        for i = 1:length(S)-2
            for j = i+1:length(S)-2
                for k = j+1:length(S)
                    sum = S(i) + S(j) + S(k) + 1;
                    if isprime(sum)
                        primes = [primes, sum];
                    endif
                endfor
            endfor
        endfor
        if length(primes) > 0
            return x;
        endif
    endfor
endfunction

