Here's a brief outline of the steps:

1. Define a function that takes a permutation as input and checks if the condition is satisfied.
2. Iterate through all possible permutations of numbers 1 to 6.
3. If a permutation satisfies the condition, return it.
4. If no permutation satisfies the condition, return an empty result.

The condition can be checked by iterating through the permutation and checking if all divisors of the current number have already appeared to its right.

Here's a simple implementation in GNU Octave:

```
function result = find_permutation(n)
    divisors = factor(n);
    for i = 1:length(divisors)
        if n(divisors(i)+1:end) ~= divisors(i)
            return false;
        end
    end
    return true;
end

permutations = permutations(6);
result = find_permutation(permutations(:,1));
for i = 2:size(permutations,2)
    if find_permutation(permutations(:,i))
        result = [result; permutations(:,i)];
    end
end
disp(result);
```

