3. Check if the calculated value is an integer.
4. If it is, print the pair $(a,b)$.

This approach can be implemented using the following code:

```octave
function pairs = find_pairs(max_a)
    pairs = zeros(0, 2);
    for a = 1:max_a
        for b = a+1:min(max_a, a*20)
