% Calculate the radius
radius = sqrt(sum((vertices - centroid).^2, 2));

% Calculate the equation of the circle
center = [centroid(1), centroid(2)];
equation = @(x) (x - center(1))^2 + (x - center(2))^2 - radius^2;

% Print the equation of the circle
