function [x, y] = ellipse_solver(A, B, C, D, E, F)
    % Completing the square for x
    A_sq = A^2;
    B_sq = B^2;
    C_sq = C^2;
    four_AC = 4*A*C;
    B_two_C = 2*B*C;
    A_four_C_sq = A_sq*four_AC;
    B_two_C_sq = B_sq*four_AC + B_two_C^2;
    A_four_C_B_two_C = A_four_C*B_two_C;
    A_four_C_B_two_C_sq = A_four_C_B_two_C^2;
    A_four_C_sq_plus_B_two_C_sq = A_four_C_sq + B_two_C_sq;
    A_four_C_B_two_C_four_AC = 4*A_four_C_B_two_C;
    A_four_C_B_two_C_four_AC_sq = A_four_C_B_two_C_four_AC^2;
    A_four_C_sq_plus_B_two_C_sq_minus_A_four_C_B_two_C_four_AC = A_four_C_sq_plus_B_two_C_sq - A_four_C_B_two_C_four_AC;
    A_four_C_sq_plus_B_two_C_sq_minus_A_four_C_B_two_C_four_AC_sq = A_four_C_sq_plus_B_two_C_sq_minus_A_four_C_B_two_C_four_AC^2;
    discriminant = A_four_C_sq_plus_B_two_C_sq_minus_A_four_C_B_two_C_four_AC_sq - 4*A_four_C_sq_plus_B_two_C_sq*F;
    x_sq = (-discriminant + sqrt(discriminant^2 - 4*A_four_C_sq_plus_B_two_C_sq_minus_A_four_C_B_two_C_four_AC_sq))/2/A_four_C_sq_plus_B_two_C_sq;
    x = sqrt(x_sq);

    % Completing the square for y
    y_sq = E^2 - 2*E*C*y - D*D - 2*D*E/C + A_four_C_sq_plus_B_two_C_sq_minus_A_four_C_sq_plus_B_two_C_sq*x_sq;
    y = sqrt(y_sq);
end

